import React, { useState } from 'react';
import { GoogleLogin } from '@react-oauth/google';
import { useNavigate } from 'react-router-dom';
import '../styles/Login.css';

const Login = () => {
  const [loginData, setLoginData] = useState({ email: '', password: '' });
  const navigate = useNavigate();

  const handleChange = (e) => {
    setLoginData({ ...loginData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form submitted:', loginData);
    // Add authentication logic here
    navigate('/user-home');
  };

  return (
    <div className="login-container">
      {/* Left Side - Logo */}
      <div className="login-left">
        <h1 className="logo">X</h1>
      </div>

      {/* Right Side - Login Form */}
      <div className="login-right">
        <h2 className="heading-main">Happening now</h2>
        <h3 className="heading-sub">Join today.</h3>

        <div className="login-buttons">
          <GoogleLogin onSuccess={() => console.log('Google Login Success')} onError={() => console.log('Login Failed')} />
          <button className="apple-button">Sign up with Apple</button>
        </div>

        <div className="divider">or</div>

        <form onSubmit={handleSubmit}>
          <input
            type="email"
            name="email"
            placeholder="Email"
            value={loginData.email}
            onChange={handleChange}
            required
          />
          <button type="submit" className="create-account">Create account</button>
        </form>

        <p className="terms-text">
          By signing up, you agree to the <a href="#">Terms of Service</a> and <a href="#">Privacy Policy</a>.
        </p>

        <div className="signin-section">
          <p>Already have an account?</p>
          <a href="/login" className="signin-link">Sign in</a>
        </div>
      </div>
    </div>
  );
};

export default Login;
